import mongoose from "mongoose";

const userSchema=new mongoose.Schema({
    name: {
        type: String,
        required: true
    },
    email: {
        type: String,
        required: true,
        unique: true
    },
    password: {
        type: String,
        required: true
    },
    image: {
        type: String,
        default: "data:image/png;base64,"
    },
    gender: {
        type: String,
        default: "Male"
    },
    dob: {
        type: String,
        default: "Not selected"
    },
    phone: {
        type: String,
        default: "0000000000"
    }
});

export const userModel=mongoose.model("User", userSchema);
